import { BrowserRouter } from "react-router-dom";
import Home from "./bootstrap/Home";

function App() {
  return (
    <BrowserRouter>
    <Routes>
        <Route path="/" element={<> <Home/> </>}></Route>

    </Routes>
</BrowserRouter>
  );
}

export default App;
